# F1_score: 0.9995002498750626
# ('F1', 'Precision', 'Recall', 'False Positives', 'False Negatives', 'False Positive Rate', 'False Negative Rate', 'Accuracy')
# (0.9995002498750626, 0.999000999000999, 1.0, 1, 0, 0.001, 0.0, 0.9995)
def get_scores(y_pred, y_gt, beta=1):
    #import numpy as np
    if y_pred.ndim > 1 or y_gt.ndim > 1:
        raise ValueError('Expected 1D inputs')
    if not y_pred.size == y_gt.size:
        raise ValueError('Expected 1D inputs of same size')
    tp = np.logical_and(y_pred, y_gt)
    precision = tp.sum() / y_pred.sum().astype(float)
    recall = tp.sum() / y_gt.sum().astype(float)
    fbeta = (1.0 + beta ** 2) * (precision * recall) / float((precision * beta ** 2) + recall)
    fp = np.sum(np.logical_and(y_pred, np.logical_not(y_gt)))
    fn = np.sum(np.logical_and(np.logical_not(y_pred), y_gt))
    tp = np.sum(np.logical_and(y_pred, y_gt))
    tn = np.sum(np.logical_and(np.logical_not(y_pred), np.logical_not(y_gt)))
    fpr = fp / float(fp + tn)
    fnr = fn / float(fn + tp)
    acc = float(tp + tn) / float(tp + tn + fp + fn)
    # ('F1', 'Precision', 'Recall', 'False Positives', 'False Negatives', 'False Positive Rate', 'False Negative Rate', 'Accuracy')
    metrics = ('F' + str(beta), 'Precision', 'Recall', 'False Positives', 'False Negatives', 'False Positive Rate', 'False Negative Rate', 'Accuracy')
    metric_values = (fbeta, precision, recall, fp, fn, fpr, fnr, acc)
    return metrics, metric_values
# The inputs are “recReconstruction_MNIST” and “recReconstruction_FMNIST”.
def evaluation_metrics(recReconstruction_MNIST, recReconstruction_FMNIST):
    # Inputs: "recReconstruction_MNIST” and “recReconstruction_FMNIST”
    y_scores = np.concatenate((recReconstruction_MNIST, recReconstruction_FMNIST), axis=0)
    y_true = np.concatenate((np.zeros(len(recReconstruction_MNIST)), np.ones(len(recReconstruction_FMNIST))), axis=0)
    y_scores = np.concatenate((recReconstruction_MNIST, recReconstruction_FMNIST), axis=0)
    y_true = np.concatenate((np.zeros(len(recReconstruction_MNIST)), np.ones(len(recReconstruction_FMNIST))), axis=0)
    y_scores = (y_scores - np.min(y_scores)) / (np.max(y_scores) - np.min(y_scores))
    print(roc_auc_score(y_true, y_scores))
    print(average_precision_score(y_true, y_scores))
    pyplot.hist(y_scores[:len(recReconstruction_MNIST)], alpha=0.5, label='Normal', density=True, color='g')
    pyplot.hist(y_scores[len(recReconstruction_MNIST):], alpha=0.5, label='Anomaly', density=True, color='r')
    labels = y_true
    d_results = y_scores
    from sklearn import metrics
    fpr1, tpr1, thresholds1 = metrics.roc_curve(labels, d_results, pos_label=1)
    fnr1 = 1 - tpr1
    eer_threshold1 = thresholds1[np.nanargmin(np.absolute((fnr1 - fpr1)))]
    eer_threshold1 = eer_threshold1
    d_f1 = np.copy(d_results)
    d_f1[d_f1 >= eer_threshold1] = 1
    d_f1[d_f1 < eer_threshold1] = 0
    f1_score = metrics.f1_score(labels, d_f1)
    print("F1_score: {0}".format(f1_score))
    metrics, metric_values = get_scores(d_f1, labels)
    print(metrics)
    print(metric_values)
    f1_score = metric_values[0]
    pyplot.hist([], color='w', label="AUROC: {:.3f}, AUPRC: {:.3f}, F1: {:.3f}".format(roc_auc_score(y_true, y_scores), average_precision_score(y_true, y_scores), f1_score))
    pyplot.hist([], color='w', label="Prec.: {:.3f}, Rec.: {:.3f}, Acc.: {:.3f}".format(metric_values[1], metric_values[2], metric_values[-1]))
    pyplot.xlabel('Anomaly Score')
    pyplot.legend(loc='upper right')
    sns.kdeplot(y_scores[:len(recReconstruction_MNIST)], color='g')
    sns.kdeplot(y_scores[len(recReconstruction_MNIST):], color='r')
    pyplot.xlim(-0.05, 1.05)
    pyplot.show()
    print("AUROC: {:.4f}".format(roc_auc_score(y_true, y_scores)))
